import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './ReportPanel.css';

export default function ReportPanel() {
  const [data,setData]=useState(null);
  const load = async ()=>{
    const {data}=await axios.get('/api/reports/overall');
    setData(data);
  };
  useEffect(()=>{ load(); },[]);

  return (
    <div className="panel">
      <h2>Raport i Përgjithshëm</h2>
      {!data && <p>Loading...</p>}
      {data && <>
        <div className="summary">
          <div><strong>Punëtorë</strong><span>{data.summary.workers}</span></div>
          <div><strong>Total Orë</strong><span>{data.summary.total_hours}</span></div>
          <div><strong>Vlera Orëve</strong><span>{data.summary.total_due.toFixed(2)} €</span></div>
          <div><strong>Paguar</strong><span>{data.summary.total_paid.toFixed(2)} €</span></div>
          <div><strong>Avanca</strong><span>{data.summary.total_advances.toFixed(2)} €</span></div>
          <div><strong>Bilanc</strong><span>{data.summary.total_balance.toFixed(2)} €</span></div>
        </div>
        <div className="list" style={{maxHeight:180}}>
          <table>
            <thead><tr><th>Punëtori</th><th>Orë</th><th>Due</th><th>Paguar</th><th>Avanca</th><th>Bilanci</th></tr></thead>
            <tbody>
              {data.workers.map(w=>(
                <tr key={w.worker.id}>
                  <td>{w.worker.first_name} {w.worker.last_name}</td>
                  <td>{w.total_hours}</td>
                  <td>{w.total_due.toFixed(2)}</td>
                  <td>{w.total_paid.toFixed(2)}</td>
                  <td>{w.total_advances.toFixed(2)}</td>
                  <td>{w.balance.toFixed(2)}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </>}
    </div>
  );
}
